// https://www.storyblok.com/tp/react-dynamic-component-from-json

import React from "react";
import Foo from "./Foo";
import Bar from "./Bar";
import Boo from "./Boo";

const ComponentsX = {
  foo: Foo,
  bar: Bar,
  boo: Boo
};


export default block => {
  console.log('-----', block.component);
  if (typeof ComponentsX[block.component] !== "undefined") {
    return React.createElement(ComponentsX[block.component], {
      key: block._uid,
      block: block
    });
  }
};
